    const navigation = useNavigate();
    const navega = (rota) => {
        navigation(rota)

    }
    return (
        <div className='pagMapa'>

            <img className='oriMap' src={mapa} />
            <img className='setaVolta' src={setaVolta} onClick={()=>{navega('')}}/>
        </div>
    )
}
export default Mapa;
